import axios from "axios";

const BASE_URL = "http://localhost:5000/api/";
const TOKEN = "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYzYjVlZjkzNTk5YjlmMGQ4ZDE3M2Y5OSIsImlzQWRtaW4iOmZhbHNlLCJpYXQiOjE2NzI5MDk2MTEsImV4cCI6MTY3MzE2ODgxMX0.EK03Dy6aSwfkh0duIYbAldrvddWbnRR4zKdPavF8ebQ"



export const userRequest = axios.create({
    baseURL: BASE_URL,
    header: { token: `Bearer ${TOKEN}` },
});
